import React from "react";
import { Card, Image } from "react-bootstrap";
import profilePic from "../assets/profile.jpg";

function Profile() {
  const user = {
    fullName: "Mirazum Munira",
    email: "mirazum.cse.20230104130@aust.edu",
    joinDate: "2025-08-20",
    profilePic,
  };

  return (
    <Card style={{ margin: "20px", marginLeft: "300px", maxWidth: "500px", padding: "20px" }}>
      <div style={{ display: "flex", alignItems: "center", gap: "20px" }}>
        <Image src={user.profilePic} roundedCircle width={80} height={80} />
        <div>
          <h3>{user.fullName}</h3>
          <p>{user.email}</p>
          <p>Date Joined: {user.joinDate}</p>
        </div>
      </div>
    </Card>
  );
}

export default Profile;
